import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'
import Profile from '../../../images/male.jpg'

export default class FriendList extends Component {
  state = {
    friendList: [
      {
        id: '01',
        name: '赵',
        gender: '男',
        profile: Profile,
      },
      {
        id: '02',
        name: '钱',
        gender: '男',
        profile: Profile,
      },
      {
        id: '03',
        name: '孙',
        gender: '女',
        profile: Profile,
      },
      {
        id: '04',
        name: '李',
        gender: '女',
        profile: Profile,
      }
    ]
  }

  openDialog = (friendId)=>{
    console.log('打开和', friendId, '的对话')
  }

  render() {
    const {friendList} = this.state;
    return (
      <div className={['container bg-success'].join(' ')}>
        {
          friendList.map((friend, index)=>{
            return (
              <div className={['row d-flex bg-primary rounded mb-2 align-items-center col-lg-4'].join(' ')} key={index} onClick={()=>{return this.openDialog(friend.id)}}>
                <div className={['col-lg-1 rounded-circle'].join()}>
                  <img className={['rounded-circle'].join(' ')} style={{width: '100%'}} src={friend.profile} />
                </div>
                <div>{friend.id}</div>
                <div>{friend.name}</div>
                <div>{friend.age}</div>
              </div>
            )
          })
        }
      </div>
    )
  }
}
